import React, { Component } from 'react'
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import Button from '@material-ui/core/Button';
import { withStyles } from '@material-ui/core/styles';


const btnStyle = {
    color: '#fff',
}

export class Event extends Component {
    infoClick = (e) => {
        e.preventDefault();
        console.log(this.props.event.name)
    }

    saveClick = (e) => {
        e.preventDefault();
        console.log("clicked save")
    }

    open= React.useState(false);
    setOpen = React.useState(false);

    handleClickOpen = () => {
        setOpen(true);
    };
    handleClose = () => {
        setOpen(false);
    };

    render() {
        return (
            <div>
                <GridListTile key={this.props.event.name} cols={1}>
                    <img src={this.props.event.pic} alt="test" />

                    <GridListTileBar title="FOOD" subtitle="MUSC"
                        actionIcon={
                            <div>
                                <Button color='secondary' style={btnStyle} onClick={this.infoClick}>More Info</Button>
                                <Button color='secondary' style={btnStyle} onClick={this.saveClick}>Add to Saved</Button>
                            </div>
                        } />
                </GridListTile>

                <div>
                    <Button variant="outlined" color="primary" onClick={handleClickOpen}>
                        Open dialog
      </Button>
                    <Dialog onClose={handleClose} aria-labelledby="customized-dialog-title" open={open}>
                        <DialogTitle id="customized-dialog-title" onClose={handleClose}>
                            Modal title
        </DialogTitle>
                        <DialogContent dividers>
                            <Typography gutterBottom>
                                Cras mattis consectetur purus sit amet fermentum. Cras justo odio, dapibus ac facilisis
                                in, egestas eget quam. Morbi leo risus, porta ac consectetur ac, vestibulum at eros.
          </Typography>
                            <Typography gutterBottom>
                                Praesent commodo cursus magna, vel scelerisque nisl consectetur et. Vivamus sagittis
                                lacus vel augue laoreet rutrum faucibus dolor auctor.
          </Typography>
                            <Typography gutterBottom>
                                Aenean lacinia bibendum nulla sed consectetur. Praesent commodo cursus magna, vel
                                scelerisque nisl consectetur et. Donec sed odio dui. Donec ullamcorper nulla non metus
                                auctor fringilla.
          </Typography>
                        </DialogContent>
                        <DialogActions>
                            <Button autoFocus onClick={handleClose} color="primary">
                                Save changes
          </Button>
                        </DialogActions>
                    </Dialog>
                </div>
            </div>

        )
    }
}

export default Event
